[2006-11-28] Resumo: [Aprovados os itens do Parecer da Comissão Especial ao Substitutivo do Senado Federal ao Projeto de Lei Complementar nº 76, de 2003, com parecer favorável, ressalvado o destaque. (Aprovação do caput do art. 1º;
do caput do art. 2º, e do parágrafo único;
dos arts. 3º ao 7º;
no art. 8º, do caput, dos incisos I a III e dos parágrafos 1º ao 9º, pelo restabelecimento dos incisos III ao VI do art. 6º do texto da Câmara, renumerados como incisos IV ao VII;
do art. 9º;
no art. 10, do caput, dos incisos I ao V e dos parágrafos 1º ao 6º;
no art. 11, do caput, dos incisos I ao XIII e dos parágrafos 1º ao 4º;
dos arts. 12 ao 16;
no art. 17, pela aprovação do caput e dos parágrafos 4º e 5º, renumerados como 1º e 2º;
no art. 18, do caput e dos seguintes dispositivos da Lei 7.827/89: parágrafo 1º do art. 4º, inciso IV do art. 5º, parágrafo único do art. 7º, caput e incisos I a IV do art. 14, art. 14-A, incisos III e V e parágrafo único do art. 15, caput e parágrafo 5º do art. 20;
no art. 19, da referência ao art. 7º da Medida Provisória 2.156-5/2001, constante do caput, e pelo restabelecimento do caput do art. 12 do texto da Câmara; dos seguintes dispositivos da Medida Provisória 2.156-5/2001: caput e parágrafos 1º e 2º do art. 3º, caput, incisos I a V, e parágrafos 1º a 4º do art. 4º, caput, incisos I a IV e parágrafo 1º do art. 6º; e caput do art. 7º;
dos arts. 20 e 21;
do art. 24, renumerado como art. 23;
e do art. 25, renumerado como 24.). Sim: 368; Não: 0; Abst.: 1; Total: 369.]. ObjVotacao: [ITENS DO SUBSTITUTIVO COM PARECER FAVORÁVEL]

[2006-11-28] Resumo: [Rejeitados os itens do Parecer da Comissão Especial ao Substitutivo do Senado Federal ao Projeto de Lei Complementar nº 76, de 2003, com parecer contrário. (Rejeição do parágrafo único do art. 1º;
no art. 2º, das expressões 'Augusto de Lima', 'Buenópolis', 'Joaquim Felício', 'Monjolos' e 'Santo Hipólito', constantes do caput;
no art. 8º, dos incisos IV e V, para fins de manutenção dos incisos III a VI do artigo 6º do texto da Câmara dos Deputados;
no art. 10, da expressão '... designando um membro da Diretoria Colegiada para a Coordenação dos trabalhos desses comitês', constantes do inciso IV, da expressão '... industriais e de infra-estrutura ...', constante do inciso I do § 6º, da expressão '... pelo agente operador, ...', constante do inciso II do parágrafo 6º, e do parágrafo 7º;
no art. 11, da expressão '... após aprovação pelo Senado Federal, na forma da alínea 'f' do inciso III do art. 52 da Constituição Federal', constante do parágrafo 1º, e da expressão '... enviando-as aos deputados e senadores, após apreciação do Conselho Deliberativo', constante do inciso VII;
no art. 17, da expressão '... concedendo empréstimos e financiamentos, com a finalidade de subscrição de ações, debêntures ou outros valores mobiliários emitidos por empresas responsáveis pela implantação de empreendimentos industriais e de infra-estrutura de grande relevância para a economia regional', constante do caput, e dos parágrafos 1º ao 3º;
no art. 18, dos seguintes dispositivos da Lei 7.827/89: parágrafos 3º a 5º do art. 4º, caput e parágrafo único do art. 9º, e caput e parágrafos 1º a 3º do art. 17-A;
no art. 19, dos seguintes dispositivos da Medida Provisória 2.156-5/2001: expressão '... e recursos de incentivos fiscais, nos termos da Constituição Federal, art. 43, § 2º, III e art. 150, § 6º, ' constante do inciso I do art. 4º, expressão 'pelo Conselho Deliberativo', constante do inciso II do art. 6º, parágrafo 2º do art. 6º, parágrafo único e incisos I a VII do art. 7º;
do art. 22, e restabelecimento do art. 16 do texto da Câmara;
do art. 23;
no art. 25, da referência ao art. 13 da Medida Provisória 2.199-14/2001.). Sim:0; Não: 280; Abst.: 0; Total: 280.]. ObjVotacao: [ITENS DO SUBSTITUTIVO COM  PARECER CONTRÁRIO]

